import {
  BrowserRouter as Router,
  Routes,
  Route,
} from "react-router-dom";
import "./post.css";
import Single from "./components/pages/Singlepage/Single";


export default function Post({wrote}) {
  return (
    <div className='post'>
        <img src="https://cdn.pixabay.com/photo/2015/12/01/20/28/road-1072821_960_720.jpg" alt="new" className="postImg" />
        <div className="postInfo">
            <div className="postCats">
                <span className="postcat">Post Category</span>
                
            </div>
            <span className="postTitle">{wrote.title1}</span>
            <span>
              <Router>
                <Routes>
            <Route path="/post/:postId" element={<Single deta={(wrote)}/>}/>
            </Routes>
            </Router>
            </span>
            <hr></hr>
            <span className="postDate">1 hour ago</span>
        </div>
        <p className="postDesc">{wrote.desc1}</p>
    </div>
  )
}
